import React from 'react'
import Layout from '../../../moleculas/layout'
import MoHead from '../../../moleculas/moHead'
import * as Util from '../../../../controller/util.js';

const atendimentoOi = function (props) {

  console.log('╔════════════════════════════════════════╗');
  console.log('║        codigo  - HTML  - Links         ║');
  console.log('╚════════════════════════════════════════╝');

  var regiao = Util.validaProps(props.regiao , "RJ");
  var modo = Util.validaProps(props.modo, "html");
  const JsonRegiao = Util.regiao(regiao);

  return (
    <div>
      <MoHead modo={modo} title="codigo HTML Link" description="codigo HTML Link" canonical="/codigo/html/links/"/>
      <Layout regiao={regiao} modo={modo}>
        <h1>HTML</h1>
        <p>Segue exmplo de Links.</p>
        <a href={JsonRegiao.timea + ".html"}>link para {JsonRegiao.timea}</a><br/>    
        <a href={"http://www." + JsonRegiao.timeb + ".com.br"}>Link para {JsonRegiab.timea}</a><br/>
        <a href={"http://www." + JsonRegiao.timeb + ".com.br"} target="_blank">Outro link com target</a><br/>
        <br />
      </Layout>
      <style jsx>{`
        .h1{
          color : #000000;
        }
        .p{
          color : #000000;
        }
      `}</style>
    </div>
  )
}

export default atendimentoOi
